import React from 'react';
import styled, {css} from 'styled-components'
import {Link} from "react-router-dom";
import {useState} from "react";

const Navigation = styled.nav`
    display: flex;
    justify-content: space-between;
    align-items: center;
    background-color: #32B006;
    height: 70px;
      @media(max-width: 768px){
        flex-direction: column;
        align-items: flex-start;
      }
`;
const Brand = styled.nav`
  margin-left: 268px;
  @media(max-width: 768px){
    display: flex;
    position: absolute;
    top: .75rem;
    left: 1rem;
    margin-left:0;
  }
`;
const NavbarLinks = styled.div`
  display: flex;
  margin-right: 268px;
  @media(max-width: 768px){
    width: 100%;
    display: none;
    opacity: 0;
    position: absolute;
    height: calc(100% - 70px);
    bottom: 0;
    margin-right: 0;
    ${props => props.active && css`
      display: flex;
      opacity: 1;
      transition: display 0s, opacity 0.5s linear;
  `}
  }
`;
const Ul = styled.ul`
    margin: 0;
    padding: 0;
    display: flex;
    align-items: center;
    background-color: #32B006;
      @media(max-width: 768px){
        flex-direction: column;
        position: relative;
        width: 100%;
      }

`;
const Li = styled.li`
    list-style: none;
    margin-right: 50px;
      @media(max-width: 768px){
        text-align: center;
      }
    & a{
      text-decoration: none;
      color: white;
      padding: 1rem;
      display: flex;
      @media(max-width: 768px){
        padding: .5rem 1rem;
      }
    }
    &:hover{
      background-color: #329410;
    }
`;
const ButtonLi = styled.li`
    width: 182px;
    height: 37px;
    background-color: #FEA711;
    color: white;
    border-radius: 90px;
    display: flex;
    justify-content: center;
    align-items: center;
`
const Space = styled.span`
  width: 10px;
  @media(max-width: 768px){
    height: auto;
    width: 100%;
  }
`;
const Hamburger = styled.div`
    display: none;
    @media(max-width: 768px){
      display: flex;
      position: absolute;
      top: .75rem;
      right: 1rem;
    }
`;
const HamburgerButton = styled.a`
  display: flex;
  flex-direction: column;
  justify-content: center;
  width: 42px;
  height: 42px;
  background-color: #329410;
  border-radius: 4px;
  ${props => props.active ? css`
        &>span:nth-child(1){
          transform: translateY(5px) rotate(45deg) ;
          transition: transform 0.5s ease;
        }
        &>span:nth-child(2){
          display: none
        }
        &>span:nth-child(3){
          transform: translateY(-5px) rotate(-45deg) ;
          transition: transform 0.5s ease;
        }
        ` 
          : css`
        &>span:nth-child(1){
        transform: translateY(0) rotate(0) ;
        transition: transform 0.5s ease;
      }
        &>span:nth-child(2){
        display: flex;
      }
        &>span:nth-child(3){
        transform: translateY(0) rotate(0) ;
        transition: transform 0.5s ease;
      }  
      `}
`;
const HamburgerLine = styled.span`
  height: 4px;
  width: 30px;
  background-color: white;
  border-radius: 4px;
  margin: 3px auto;
  
`;


